import React from "react";
import "./Header.css";

function Header() {
  return (
    <div>
      <div className="searchBar">
        คนละครึ่ง
        <label>
          <input placeholder="ค้นหา ชื่อ ร้านอาหาร และเครื่องดื่ม ร้านธงฟ้า ร้านค้า OTOP และสินค้าทั่วไป"></input>
          <button></button>
        </label>
      </div>

      <div className="header">
        <div>หน้าแรก / ค้นหา</div>
      </div>
      <div>ผลการค้นหา ร้านอาหารและเครื่องดื่ม</div>
    </div>
  );
}

export default Header;
